(335, 1057, 97, '2021-01-26 17:07:28', NULL, NULL, NULL, NULL, '၆၀', 1, 1, 0, NULL, '၃၁၁၀၀၆၇၇၄၁', '(၁၁-၆.၆/၀.၄)ကေဗွီ၊(၄၀၀)ကေဗွီအေ (အားကစားနှင့်ကာယပညာဉီးစီးဌာနပိုင်)', '395', '2021-01-26 08:25:00', 400, 286, 330, 333, 70, 0, 0, '3phase,4wire Insulated Cable 120mm2', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '၁၃.၁၈၂ကီလိုဝပ်', NULL, NULL, 2, '1', 'amg7tv_1611680848.jpg', '11.2', '22.1', '(၁၁-၆.၆/၀.၄)ကေဗွီ၊(၄၀၀)ကေဗွီအေ  ထရန်‌စဖော်မာသည် အားကစားနှင့်ကာယ  ပညာဉီးစီးဌာနပိုင်ဖြစ်ပြီး    ၎င်းထရန်‌စဖော်မာ၏ ပြုပြင်ထိန်းသိမ်းမှုကိစ္စများအတွက်  သာယာရေးကော်မတီ ဖွဲ့စည်းထားပါသည်။ ၎င်းထရန်‌စဖော်မာမှဓာတ်အားဆက်သွယ်ပေးနိုင်ရန်အတွက်  သာယာရေးကော်မတီမှ အဆိုပါ စက်မှုသုံးပါဝါမီတာလျှောက်ထားမှုအား လတ်တလောတွင် ကန့်ကွက်ရန်မရှိကြောင်း ထောက်ခံချက် မပေးနိုင်ကြောင်း သိရှိပါသည်။အားကစားနှင့်ကာယ  ပညာဉီးစီးဌာနသည်  သာယာရေးကော်မတီအသစ်ပြန်လည်ဖွဲ့စည်းမည်ဖြစ်ကြောင်းသိရှိရပါသည်။သို့ဖြစ်၍ လျှောက်ထားသူကာယကံရှင်ထံမှ ၎င်းမီတာလျှောက်ထားမှုနှင့်ပတ်သက်၍  တစ်စုံတစ်ဉီး (သို့မဟုတ်) အဖွဲ့အစည်းတစ်ခုမှ ကန့်ကွက်ခြင်းအစရှိသော ကိစ္စများပေါ်ပေါက်လာပါက မီတာအားပြန်လည်ဖြုတ်သိမ်းမည်ဖြစ်ကြောင်းနှင့် မီတာနှင့်ပတ်သက်သောကိစ္စများအား ကာယကံရှင်မှ တာဝန်ယူဖြေရှင်းမည်ဖြစ်ကြောင်း  ဝန်ခံကတိ တောင်းခံထားပါသည်။', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'yF7Crg_1611680848.jpg', NULL, '၁၁-၆.၆/၀.၄ကေဗွီ၊၄၀၀ကေဗွီအေ (အားကစားနှင့်ကာယပညာဉီးစီးဌာနပိုင်)', NULL, NULL, NULL, '2021-01-25 16:09:46', '2021-01-26 17:07:28'),
