(951, 754, 135, 305, 5, '2021-01-15 15:10:37', '<p>လူကြီးမင်း လျှောက်ထားသော ထရန်စဖော်မာ ( လျှောက်လွှာအမှတ်စဉ်-<span class=\"text-danger\">YGN-1610717255</span> ) မှာ ငွေသွင်းရန်အဆင့်သို့ ရောက်ရှိနေပြီဖြစ်ပါသောကြောင့် အောက်ဖေါ်ပြပါ လင့်ခ် (Link) ကိုနှိပ်၍ ကျသင့်ငွေအား အွန်လိုင်းငွေချေစနစ်ဖြင့် ငွေပေးသွင်းနိုင်ပြီ ဖြစ်ပါသည်။ လုပ်ငန်းစဉ်များ ဆက်လက်လုပ်ဆောင်နိုင်ရန်အတွက် လူကြီးမင်းတို့အနေဖြင့် သက်မှတ်ရက် ( <span class=\"text-danger\">22-01-2021 ၂:၀၀ နာရီ</span> ) ထက်နောက်မကျဘဲ ငွေသွင်းပေးပါရန် အကြောင်းကြားပါသည်။</p><div class=\"text-center mt-5 mb-5\"><a href=\"http://eform.moee.gov.mm/paymentForm/754\" class=\"btn btn-info text-center\">Click for payment</a></div>', 0, 0, '2021-01-15 15:10:37', '2021-01-15 15:10:37'),
(952, 780, 139, 300, 5, '2021-01-15 15:10:45', '<p>လူကြီးမင်း လျှောက်ထားသော အိမ်သုံးမီတာ ( လျှောက်လွှာအမှတ်စဉ်-<span class=\"text-danger\">YGN-1610722845</span> ) မှာ ငွေသွင်းရန်အဆင့်သို့ ရောက်ရှိနေပြီဖြစ်ပါသောကြောင့် လျှောက်လွှာအတွင်းပါရှိသော အထောက်အထားများ၏ မူရင်းများကို တပါတည်းယူဆောင်၍ သက်မှတ်ရက် ( <span class=\"text-danger\">22-01-2021</span> )ထက်နောက်မကျစေဘဲ ရုံးသို့ လူကိုယ်တိုင် လာရောက် ငွေသွင်းနိုင်ပြီဖြစ်ကြောင်း အကြောင်းကြားပါသည်။</p>', 1, 0, '2021-01-15 15:10:45', '2021-01-29 12:44:48'),
